// Code node: Format Link Response (Run Once per Item)

// Ambil pesan asli dari Telegram Trigger (item pertama)
const trig = $item(0).$node["Telegram Trigger"].json || {};
const msg  = trig.message || {};

const ok =
  $json?.status === 'success' ||
  $json?.ok === true ||
  $json?.linked === true;

let text;
if (ok) {
  const name = $json?.user?.name || $json?.user?.username || 'User';
  text =
    `✅ Link berhasil!\n` +
    `Akun: ${name}\n` +
    `Sekarang kamu bisa kirim pengeluaran sebagai teks (mis: "kopi 25k; tol 15k t: jalan-jalan") ` +
    `atau foto struk (kirim sebagai *Document*), opsional dengan caption "t: tag1, tag2".`;
} else {
  const reason = $json?.message || $json?.error || 'Kode link tidak valid / sudah dipakai.';
  text = `❌ Gagal link.\n${reason}\n\nKetik: /link <kode> lalu kirim lagi.`;
}

// Keluarkan satu item dengan field yang dibutuhkan node Telegram
return {
  json: {
    text,
    chat_id: msg.chat?.id,
    reply_to: msg.message_id,
  }
};

const response = $json.body || {};
const message = $node["Telegram Trigger"].json?.message || {};
const binary = $node["Telegram Trigger"].binary || undefined;

return [{
  json: {
    ...response,
    message,
    chat: message.chat,
    chatId: message.chat?.id
  },
  binary
}];

// ===== Helpers =====
function stripFences(text) {
  return String(text ?? '')
    .trim()
    .replace(/^```(?:json)?\s*/i, '')
    .replace(/```$/i, '')
    .trim();
}

// Parse robust: object | array | concatenated objects "{...}{...}"
function parseModelContent(raw) {
  let t = stripFences(raw);
  try { return JSON.parse(t); } catch {}
  const joined = `[${t.replace(/}\s*{/g, '},{')}]`;
  try { return JSON.parse(joined); } catch {}
  const objs = t.match(/{[\s\S]*?}/g);
  if (objs && objs.length) {
    try { return objs.map(s => JSON.parse(s)); } catch {}
  }
  throw new Error('Failed to parse JSON from model content');
}

const CATEGORY_MAP = {
  food_drinks:'Food', food:'Food',
  transport:'Transport', fuel:'Fuel',
  shopping:'Shopping',
  bills_utilities:'Bills', bills:'Bills',
  entertainment:'Entertainment',
  health_fitness:'Health & Fitness',
  groceries:'Groceries',
  personal_care:'Personal Care',
  software_subscription:'Software',
  misc:'Miscellaneous', miscellaneous:'Miscellaneous',
};
const mapCategory = (cat) => CATEGORY_MAP[String(cat || '').toLowerCase()] || 'Miscellaneous';

const now = new Date();
const MAX_SKEW_DAYS = 1;
function coerceDate(input) {
  if (!input) return now.toISOString();
  const d = new Date(input);
  if (isNaN(d)) return now.toISOString();
  const diff = Math.abs(d - now) / 86400000;
  return diff > MAX_SKEW_DAYS ? now.toISOString() : d.toISOString();
}
const normCurrency = (c) => String(c || 'idr').trim().toLowerCase();

// ===== Ambil konten dari node Message a model =====
const content =
  $json?.message?.content ??
  $json?.output_text ??
  $json?.choices?.[0]?.message?.content ??
  $json?.content;

if (typeof content !== 'string') {
  throw new Error('Assistant content not found — make sure this node receives output from "Message a model".');
}

// ===== Split pesan mentah jadi CHUNKS (per transaksi) untuk tarik tags lokal =====
const rawText =
  $node["Telegram Trigger"].json?.message?.text ??
  $node["Telegram Trigger"].json?.message?.caption ?? '';
const chunks = String(rawText)
  .split(';')
  .map(s => s.trim())
  .filter(Boolean);

// helper: extract tags from a single chunk (stop before ';')
function tagsFromChunk(chunk) {
  const m = String(chunk).match(/\bt\s*:\s*([^\n;]+)/i);
  if (!m) return [];
  return m[1].split(',').map(s => s.trim()).filter(Boolean);
}

// ===== Parse & normalize =====
const parsed = parseModelContent(content);
const arr = Array.isArray(parsed)
  ? parsed
  : (Array.isArray(parsed?.items) ? parsed.items : [parsed]);

const out = [];
for (let i = 0; i < arr.length; i++) {
  const obj = arr[i] || {};
  const amt = Number(obj.amount);

  // tags lokal berdasar index chunk yang sama
  const localTags = i < chunks.length ? tagsFromChunk(chunks[i]) : [];

  // tags dari LLM (kalau ada)
  const llmTags = Array.isArray(obj.tags)
    ? obj.tags.map(String).map(s => s.trim()).filter(Boolean)
    : [];

  // merge tanpa duplikat; jika kosong, jangan set field tags
  const mergedTags = [...new Set([...llmTags, ...localTags])];

  const payload = {
    name: obj.name ?? 'Expense from n8n',
    category: mapCategory(obj.category),
    amount: isNaN(amt) ? 0 : -Math.abs(amt), // expense negatif
    currency: normCurrency(obj.currency),
    date: coerceDate(obj.date),
  };
  if (mergedTags.length) payload.tags = mergedTags;

  out.push({ json: payload });
}

return out;

/**
 * Code node (Run Once per Item)
 * Input:
 *  - Jika dari Analyze image (Resource=Image), biasanya $json.content = "```json {...} ```"
 *  - Jika sudah structured JSON, langsung ada di $json
 * Output: { name, category, amount, currency, date }
 */

const MAP = {
  food_drinks:'Food', food:'Food',
  transport:'Transport', fuel:'Fuel',
  shopping:'Shopping',
  bills_utilities:'Bills', bills:'Bills',
  entertainment:'Entertainment',
  health_fitness:'Health & Fitness',
  groceries:'Groceries',
  personal_care:'Personal Care',
  software_subscription:'Software',
  misc:'Miscellaneous', miscellaneous:'Miscellaneous',
};

const now = new Date();
const MAX_SKEW_DAYS = 7;

function saneDate(s) {
  const d = s ? new Date(s) : now;
  if (isNaN(d)) return now.toISOString();
  const diffDays = Math.abs(d - now) / 86400000;
  return diffDays > MAX_SKEW_DAYS ? now.toISOString() : d.toISOString();
}

function normCurrency(c) {
  return String(c || 'idr').trim().toLowerCase();
}

function normCat(raw) {
  // normalisasi: lowercase, non-alnum jadi underscore, collapse underscores
  const k = String(raw || '').toLowerCase().replace(/[^a-z0-9]+/g, '_').replace(/^_+|_+$/g,'');
  return MAP[k] || 'Miscellaneous';
}

function parseLooseJson(text) {
  let t = String(text ?? '').trim();
  // strip code fences ```json ... ```
  t = t.replace(/^```(?:json)?\\s*/i, '').replace(/```$/i, '').trim();
  try { return JSON.parse(t); } catch (e) {
    // fallback: ambil blok {...} pertama
    const s = t.indexOf('{'), e2 = t.lastIndexOf('}');
    if (s !== -1 && e2 > s) {
      return JSON.parse(t.slice(s, e2 + 1));
    }
    throw new Error('Failed to parse JSON from content');
  }
}

// ---- ambil sumber data dari Analyze image ----
let obj;
if (typeof $json?.content === 'string') {
  obj = parseLooseJson($json.content);
} else {
  // sudah berupa object dari upstream (structured outputs)
  obj = $json || {};
}

const base = $item(0).$node['Assemble Context'].json || {};
const meta = {
  userId: base.userId,
  ingestToken: base.ingestToken,
  linkId: base.id,
};

if (!meta.userId || !meta.ingestToken) {
  throw new Error('Missing ingest metadata');
}
// ---- bentuk payload final ----
return {
  json: {
    name: obj.name ?? 'Expense from n8n',
    category: normCat(obj.category),
    amount: -Math.abs(Number(obj.amount ?? 0)),
    currency: normCurrency(obj.currency),
    date: saneDate(obj.date),
    _meta: meta
  }
};
